function createReportDocumentLinks(n,t){var r=t.data.documents,i='<span><ul class="list-unstyled">';r.forEach(function(n){i+='<li class="doc-link"><a href="#myModal" data-document-viewer data-doc-id="'+n.id+'" data-url="/document/'+n.id+'" data-toggle="modal" data-target="#myModal" data-title="'+n.filename+'" data-toggle="tooltip" title="'+n.filename+'" data-placement="right" data-original-title="'+n.filename+'">v.'+n.version+" - "+n.filename+"<\/a><\/li>"});i+="<\/ul><\/span>";n.append(i)}(function(){console.log("reports ready")});$("a[data-document-viewer]").each(function(){var n=$(this).data("doc-id");$("[data-doc-id="+n+"]").on("click",function(){var t=$(this),r=t.data("title"),i=t.data("url");$.ajax({url:i,type:"POST",success:function(){window.BootstrapDialog.show({size:window.BootstrapDialog.SIZE_WIDE,draggable:!0,title:r,message:$("<div><\/div>").load(i,function(n,t){t==="error"&&window.$log.error("Error showing history")}),buttons:[{label:"Close",action:function(n){n.close()}},{label:"Download",cssClass:"btn-primary",action:function(t){var i="/download/"+n;window.downloadFile(i);window.$log.info("Your file is being downloaded");t.close()}}]})},error:function(){window.$log.error("Error showing file contents")}})})});